function Splash() {
  return (
    <div className="splash">
      <h1>John: a front-end web developer</h1>
      <p>Web Developer</p>
      <p>
        I'm a 19 year old living in Houston, TX. I love building responsive
        websites and applying new technologies.
      </p>
    </div>
  );
}

export default Splash;
